import React, { Component } from 'react'

import { Row, Col } from 'antd';


export default class Admin extends Component {
    render () {
        return (
            <Row>
                <Col span="3" style={{ background: "#fcf" }}>
                    left
                </Col>
                <Col span="21" style={{ background: "#fcc" }}>
                    right
                </Col>
            </Row>
        )
    }
}
